                    Entusiasta e apaixoinado por tecnologia, primeiro projeto em React para aprendizado.
                </p>
                <footer>
                    <p>
                        Pre√ßo/hora <strong>50,00 </strong> 
                    </p>
                    <button type="button" >
                        <img src={WhatSapp} alt="entrar em contato via whatsapp"/> Entre em contato
                    </button>
                </footer>
            </article>
    );
}
